import { useParams } from "react-router-dom"
export function FoundClimber({climbers}){
    const {climberID} = useParams();
    function findClimber() {
        return climbers.find(climber => climber.id === parseInt(climberID))
      }
    return <h1>{findClimber().name}</h1>
}
